import React from 'react';
import { CgSearch } from 'react-icons/cg';

export default function ChatSearchUser() {
    return (
        <div className="flex items-center">
            <CgSearch />
            <input
                className="w-full bg-cyan-500/80 outline-none px-3 py-1"
                placeholder=""
            />
        </div>
    );
}
